import React, { useState } from "react";
import Upvote from "react-upvote";

const Vote = () => {
  const [count, setCount] = useState(0);

  const increment = (e) => {
    setCount(count + 1);
    e.preventDefault();
  };

  const decrement = () => {
    setCount(count - 1);
  };

  return (
    <div>
      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decrement</button>
      <div>{count}</div>
    </div>
  );
};

export default Vote;
